def dist(x1, y1, x2, y2):
    return math.sqrt((x1 - x2)**2 + (y1 - y2)**2)

def is_intersect(x1, y1, r1, x2, y2, r2):
    return dist(x1, y1, x2, y2) <= r1 + r2

def is_inside(x, y, r):
    return dist(x, y, 0, 0) <= r

