    s = [['.' for _ in range(c)] for _ in range(r)]
    s[i][j] = 'A'
    step = 1
    while n > 0:
        step += 1
        if step > 26:
            step = 1
        if s[i][j] != '.':
            continue
        if step == 26:
            s[i][j] = 'Z'
            continue
        if step == 27:
            s[i][j] = 'A'
            continue
        step = chr(ord('A') + step - 1)
        if s[i][j] == step:
            continue
        s[i][j] = step
        n -= 1
    return '\n'.join([''.join(row) for row in s])

