def sieve_of_eratosthenes(n):
    primes = [True for i in range(n+1)]
    p = 2
    while (p * p <= n):
        if (primes[p] == True):
            for i in range(p * 2, n+1, p):
                primes[i] = False
        p += 1
    return [p for p in range(n+1) if primes[p]]
def find_crossed_out(n, k):
    primes = sieve_of_eratosthenes(n)
    return primes[k-1]

